import React, { useState, useEffect } from "react";
import getData from "./axios";

const Getdata = () => {
  useEffect(() => {
    (async () => {
      let s = await getData("1", "get");
      console.log(s);
    })();
  }, []);
  return (
    <div>
      <h1> hello word</h1>
    </div>
  );
};

export default Getdata;
